  input: TEXT,"F3XA","","Amending the Amended 30 Day Post-General Report 10/19/06-11/27/06
    in response to FEC letter Dated March 28, 2007. Item 1. I have corrected the lines
    on the Detailed Summary Page that were incorrect. When I amended the previous
    report those figures changed and am amending this report to carry the correct
    figures forward. Item 2. Several items were amended and entered due to input error
    and systems problems with importing data which caused some contributions and distribution
    not to be uploaded correctly, was able correct all the items on the amended report
    completed 12/14/2006. Item 3. Please note that the fund transfers-in from the
    DSCC and the DNC were not used for exempt activity. Furthermore payments for exempt
    mail, exempt t-shirts, exempt canvass (exempt canvass I have amended description
    to exempt canvass literature) does in fact comply with all of the requirements
    for exempt activity. Item 4. Postage totaling $975.00 was not use for public communication
    or used on behalf of a clearly identified Federal candidate. Item 5. I have amended
    those payments on line 30(b) that did refer to a Federal Candidate and these items
    did meet conditions of exempt activity. I also made note to the record of those
    that did not refer to a Federal Candidate, that were generic in nature and not
    candidate specific. Item 6. I have amended the description for all items requested
    and also clarified if they referred to a Federal Candidate. Item 7. I have amended
    the report providing the purpose for each disbursement itemized on line 21(b)
    and 30(b). Item 8. The payment for photographer was not for a public communication
    nor was it used to refer to any identified federal candidate. Item 9. Expenditure
    made for Gospel Rally Consultant was generic and not candidate specific.  Item
    10. Payment disclosed on Schedule H4 for polling was for general poll which no
    IDing was preformed and no information was appended to our voterfile therefore
    does not meet the definition of FEA.  Item 11. I have amended Schedule H4 to include
    missing information of itemized memo entries for payments to original vendors
    for reimbursements to individuals. Item 12. I have amended the memo entries made
    relating to disbursement for reimbursement to Julie Andreeff to reflect the correct
    amount of 417.95. Item 13. I have amended Schedule H4 for reimbursement for travel
    that exceeded $500.00 to include itemized memo entries that reflect the reimbursement.
    Item 14. I have amended the report and corrected the year-to-date total calculations
    for the Administrative category. Item 15. Clarifying expenditure for Dinner Sponsor
    tickets that we purchased to attend a dinner of the Legislative Black Caucus that
    was not on behalf of an identified Federal Candidate, music entertainment was
    for event generic in nature, not for a fundraiser, Room rental see Doug Thornell
    was for venue rental for a meeting not a fundraiser, space permit see David Paulson
    was for a venue rental not a fundraiser and none of the expenses were made on
    behalf of any Federal Candidate. Item 16. I have amended Schedule F by providing
    office sought, State and district. Also note that in the amended Post general
    report I stated that the year end would be amended to relate that the Victory
    fund transfer in for 4367.39 reported in this report to a future memo schedule.
    That was incorrect it relates to the memo schedules reported in the October Monthly
    2006 report."
